import { useState, useEffect } from 'react'
import { API_BASE_URL } from './constans/api'
import Header from './layout/Header'
import Download from './layout/Download'
import Warranty from './layout/Warranty'
import Care from './layout/Care'

const App = () => {
  const [data, setData] = useState({})
  const {
    header, 
    warranty, 
    care, 
    cashback, 
    clients, 
    footer,
    modal
  } = data

  useEffect(() => {
    fetch(API_BASE_URL)
      .then(response => {
        if (response.ok) {
          return response.json()
        }
      })
      .then(data => setData(data))
      .catch(error => console.error(error))
  }, [])

  return (
    <>    
      {data.header && (
        <Header 
          className={header.name}
          data={header}
        />
      )}
      {data.download && (
        <Download
          className={download.name}
          data={download}
        />
      )}
      {data.warranty && (
        <Warranty
          className={data.warranty.name}
          data={data.warranty}
        />
      )}
      {data.care && (
        <Care
          className={data.care.name}
          data={data.care}
        />
      )}
    </>
  )
}

export default App
